import {Modal, ModalContent, ModalHeader, ModalBody, ModalFooter, Button, useDisclosure} from "@nextui-org/react";

export default function RightColumn({ children }) {
    const {isOpen, onOpen, onOpenChange} = useDisclosure();

    return (
        <div class="w-full md:w-2/3 text-left px-4 font-custom">
            <p class="text-2xl font-semibold"> About </p>
            <p class=" mb-5 text-lg"> {children} </p>

            <div className="items-center flex justify-center">
                <Button onPress={onOpen} color="primary" variant="shadow">Read Research</Button>
                <Modal 
                    size="4xl"
                    isOpen={isOpen} 
                    onOpenChange={onOpenChange}
                    scrollBehavior="inside"
                    backdrop="blur"
                >
                    <ModalContent>
                        {(onClose) => (
                            <>
                                <ModalHeader className="flex flex-col gap-1">Modal Title</ModalHeader>
                                <ModalBody>
                                    {chil}
                                </ModalBody>
                                <ModalFooter>
                                <Button color="primary" onPress={onClose}>
                                    Close
                                </Button>
                                </ModalFooter>
                            </>
                        )}
                    </ModalContent>
                </Modal>
            </div>
        </div>
    );
}
